  const options = ['MT1', 'MT2', 'MT3'];
  return (
    <body>
        <div className="home-container">
            <div className="wrapper-counter">
                <div className="counter-container">
                    <h1>3</h1><p>days</p>
                </div>
            </div>
        </div>
    </body>
  );
}

export default HomePage;
